import React, { Component } from "react";

export default class Nav extends Component {
  render() {
    return (
      <>
        <div id="background_division"></div>
        <div id="navigation">
          <div className="nav-items">
            <span>Pixabay</span>
            <span>Search Pixabay</span>
            <span>All Images</span>
            <span>Explore</span>
            <span>Notifications</span>
            <span>Upload</span>
          </div>
        </div>
      </>
    );
  }
}
